class Solution:    def singleNumber(self, nums):        """        :type nums: List[int]        :rtype: int        """        n,dict1=len(nums),{}        for i in range(n):            if nums[i] not in dict1:                dict1[nums[i]]=1            else:                dict1[nums[i]]+=1        for key,value in dict1.items():            if value==1:                return key        returns=Solution()print(s.solve([["X","X","X","X"],["X","O","O","X"],["X","X","O","X"],["X","O","X","X"]]))